  private static final String TEST_STRING_7 = "";


  @Test
  public void test() {
    BwtDualPivotQuicksort bwtSort = new BwtDualPivotQuicksort();
    long t0 = System.currentTimeMillis();
    byte[] bytes = TEST_STRING_7.getBytes();
    for (int i = 0; i < 100; i++) {
      bwtSort.sort(bytes);
    }
    System.out.println(String.format("elapsed %dms for %d elems", System.currentTimeMillis()-t0, bytes.length));
  }


  @Test
  public void shouldSort() {
    // given
    BwtDualPivotQuicksort bwtSort = new BwtDualPivotQuicksort();
    // do
    int[] sortedIndicesShort = bwtSort.sort(BYTES_SHORT);
    int[] sortedIndicesLong = bwtSort.sort(BYTES_LONG);
    // then
    Assert.assertArrayEquals(EXPECTED_SHORT, getSortedBytes(sortedIndicesShort, BYTES_SHORT));
    Assert.assertArrayEquals(EXPECTED_LONG, getSortedBytes(sortedIndicesLong, BYTES_LONG));
  }


  @Test
  public void shouldComputeShortIndices() {
    // given
    BwtDualPivotQuicksort bwtSort = new BwtDualPivotQuicksort();
    // do
    int[] sortedIndices = bwtSort.sort(BYTES_SHORT);
    // then
    Assert.assertArrayEquals(EXPECTED_SHORT_INDICES, sortedIndices);
  }

  @Test
  public void shouldComputeLongIndices() {
    // given
    BwtDualPivotQuicksort bwtSort = new BwtDualPivotQuicksort();
    // do
    int[] sortedIndices = bwtSort.sort(BYTES_LONG);
    // then
    Assert.assertArrayEquals(EXPECTED_LONG_INDICES, sortedIndices);
  }

  private byte[] getSortedBytes(int[] indices, byte[] initialArray) {
    byte[] bytes = new byte[initialArray.length];
    for (int i = 0; i < initialArray.length; i++) {
      bytes[i] = initialArray[indices[i]];
    }
    return bytes;
  }
